@implementation PinyinHelper

#pragma mark 用于检索的拼音串(例:重庆 结果:chongqing zhongqing chong qing zhong qing cq zq)
+ (NSString*)getSearchPinyin:(NSString*)oStr {
    NSMutableString *resultStr = [NSMutableString string];
    
    NSMutableString *firstStr = [NSMutableString string];
    
    for (int j=0; j<2; j++) {
        //只取两个音
        for (int i=0; i<oStr.length; i++) {
            unichar tempChar = [oStr characterAtIndex:i];
            char *py = NULL;
            long long index = 0;
            BOOL chinese = isChinese(tempChar);
            
            if (chinese) {
                index = getPinyinIndex(tempChar);
                py = (char*)getPinyin(index, j);
            } else {
                //非中文直接不处理
                py = (char*)&tempChar;
            }
            
            if (py!=NULL) {
                [resultStr appendFormat:@"%s",py];
                
                if (chinese) {
                    [firstStr appendFormat:@"%c",py[0]];
                }
            } else {
                const char *py2 = getPinyin(index, 0);
                if (py2!=NULL) {
                    [resultStr appendFormat:@"%s",py2];
                    [firstStr appendFormat:@"%c",py2[0]];
                }
            }
        }
        [resultStr appendString:@"$"];
        [firstStr appendString:@"$"];
    }
    [resultStr appendString:firstStr];
    //NSLog(@"%@",resultStr);
    return resultStr;
}

#pragma mark 用于语音检索的拼音串(例:重庆 结果:chongqing zhongqing)
+ (NSArray <NSString *>*)getAudioSearchPinyin:(NSString*)oStr {
    NSMutableArray *arrResult = [NSMutableArray arrayWithCapacity:2];
//    for (int j=0; j<2; j++) {
        //只取两个音
        NSMutableString *resultStr = [NSMutableString string];
        for (int i=0; i<oStr.length; i++) {
            unichar tempChar = [oStr characterAtIndex:i];
            char *py = NULL;
            long long index = 0;
            BOOL chinese = isChinese(tempChar);
            
            if (chinese) {
                index = getPinyinIndex(tempChar);
//                py = (char*)getPinyin(index, j);
                py = (char*)getPinyin(index, 0);
            } else {
                //非中文直接不处理
                py = (char*)&tempChar;
            }
            
            if (py!=NULL) {
                [resultStr appendFormat:@"%s",py];
            }
        }
        if (resultStr.length > 0) {
            [arrResult addObject:[resultStr uppercaseString]];
        }
//    }
    return arrResult;
}

#pragma mark 准备语音检索数据(例:重庆 结果:chongqing zhongqing)
+ (NSString *)getAudioSearchData:(NSString*)oStr {
    NSMutableString *resultStrLast = [NSMutableString string];
    for (int j=0; j<2; j++) {
        //只取两个音
        NSMutableString *resultStr = [NSMutableString string];
        for (int i=0; i<oStr.length; i++) {
            unichar tempChar = [oStr characterAtIndex:i];
            char *py = NULL;
            long long index = 0;
            BOOL chinese = isChinese(tempChar);
            
            if (chinese) {
                index = getPinyinIndex(tempChar);
                py = (char*)getPinyin(index, j);
            } else {
                //非中文直接不处理
                py = (char*)&tempChar;
            }
            
            if (py!=NULL) {
                [resultStr appendFormat:@"%s",py];
                
            } else {
                const char *py2 = getPinyin(index, 0);
                if (py2!=NULL) {
                    [resultStr appendFormat:@"%s",py2];
                }
            }
        }
        if (resultStr.length==0) {
            continue;
        }
        if (resultStrLast.length==0) {
            [resultStrLast appendString:resultStr];
        } else if (resultStrLast.length > 0 && ![resultStrLast isEqualToString:resultStr]) {
            [resultStrLast appendFormat:@"$%@",resultStr];
        }
    }
    return resultStrLast;
}

#pragma mark 辨别数字
+ (NSString *)checkNumWithString:(NSString *)str {
    [SZCommonMethods normalizedPhoneNumber:str];
    return str;
}

#pragma mark - ************************************核心函数************************************
#pragma mark 获取多音字的拼音,which为0到3因为汉字最多4个音
const char* getPinyin(long index, int which) {
    int trueIndex = (index >> (16 * which)) & 0xFFFF;
    if (trueIndex!=0&&trueIndex<PinYinCount) {
        return PinYin[trueIndex];
    } else {
        return NULL;
    }
}

#pragma mark 获取拼音首字母
const char getFirstLetter(unichar hanzi) {
    long long index = getPinyinIndex(hanzi);
    
    const char *result = getPinyin(index, 0);
    if (result!=NULL) {
        return result[0];
    } else {
        return hanzi;
    }
}

#pragma mark 获取该汉字对应的拼音index,但是该index如果大于PinYinCount就说明这个字是多音字需要进一步分解多音字index
long long getPinyinIndex(unichar hanzi) {
    unsigned char t1 = (hanzi >> 8) & 0xFF;
    unsigned char t2 = hanzi & 0xFF;
    long long pyIndex = 0;
    
    if(t1>=78&&t1<=159) {
        pyIndex = PinyinIndex[t1-78][t2] - 1;
    }
    
    return pyIndex;
}

#pragma mark 0为非汉字,1为汉字
int isChinese(unichar hanzi) {
    if (hanzi>=0x4E00&&hanzi<=0x9FA5) {
        return 1;
    } else {
        return 0;
    }
}

